import React from 'react'
import Navbar from '../component/Navbar';
import Banner from '../component/Banner';
import SignIn from '../pages/SignIn';
import Carousels from '../component/carousels';
import CategoryCards from '../component/categorycards';
import OfferBanners from  '../component/offerBanners';
import TataCliqOffers from  '../component/offercards';
import ProductList from '../component/dummyapi';
import IndianwearBanner from '../component/indianwearbanner';

function Home() {
  
  return (
    <>
    <Navbar></Navbar>
    <Banner/>
    <Carousels/>
    <CategoryCards/>
    <OfferBanners/>
    <TataCliqOffers/>
    {/*<ProductList/>*/}
    <IndianwearBanner/>
</>
  )
}

export default Home
